import React, { Component } from 'react';
class Properties extends Component {
  constructor(props) {
    console.log(props);
    super(props);
    this.state = {
      isShow: true,
    };
  }
  render() {
    const greeting = 'Welcome to React';
    return (
        ''
    );
  }
}
export default Properties;
